import React from 'react';
import './ContactContent.css';
import pic from './self.jpeg';

const ContactContent = (props) =>
{
  return (
    <div className="ContactContent">
      <h1>Feel free to contact me:</h1>

      <img src={pic} alt="really good pic of me"/>


      <p>
        Pavlo Triantafyllides<br/>
        GitHub: <a href="https://github.com/pavlo-tech" target="__blank">pavlo-tech</a>
        Linkedin: <a href="https://www.linkedin.com/in/pavlo-triantafyllides/" target="__blank">pavlo-triantafyllides</a>
        Email: <a href="mailto:triantafyllides@gmail.com">triantafyllides@gmail.com</a>
        </p>
    </div>
  );
}
export default ContactContent;
